import { Link } from "react-router-dom";
const Menu = () => {
  return (
    <nav>
      <ul>
        <li>
          <Link to="/">Home</Link>
        </li>
      </ul>
      <li>
        <Link to="/about">About Us</Link>
      </li>

      <li>
        <Link to="/contact">Contact Us</Link>
      </li>
    </nav>
  );
};

export default Menu;
